10倍に薄めて使用する速効除草剤<br><br>アミノ酸系と速効性のあるMCPAをダブル配合した、速効性（3～7日で効果発現）がある非農耕地用除草剤です。<br>枯らせたい雑草だけを狙って枯らす事ができ、しつこいスギナにも効果があります。<br><br>容量：200ml<br>商品サイズ（cm）：幅約11×奥行約5×高さ約20<br>重量：約300g<br>成分：グリホサートイソプロピルアミン塩8.5％、MCPAイソプロピルアミン塩1.75％<br>対象雑草：一般雑草（一年生・多年生）：20～40ml／平方メートル、スギナ：80～100ml／平方メートル<br>適用場所：宅地、駐車場、工場敷地、のり面などの非農耕地<br>生産国：日本<table width="800" border="0" cellspacing="0" cellpadding="0">

